import React from 'react'
import './App.css'


export default function App() {
  let board =[];
  for(let i=0; i<3; i++){
    for(let j=0; j<3; j++){
      board.push(
        <div
          key = {`${i}-${j}`}
          style ={{height:'50px', width:'50px', border:'1px solid black'}}
        />
      )
    }
  }
  return (
      <div className='App' style={{height:'468px', width: '468px'}}>
        {board}
      </div>
  )
}
